import React from 'react'
import { makeStyles, Container, Box, Grid } from '@material-ui/core'
import { PositionImage, Paragraphs, MainContainer } from "../atoms"
import Bounce from 'react-reveal/Bounce';


const useStyles = makeStyles((theme) => ({
    mainHeads: {
        display: 'flex',
        justifyContent: 'center',
        // alignItems:'center',
        [theme.breakpoints.down('sm')]: {
            lineHeight: '1.2',
        },
    },
    qualityContainer: {
        height: 'fit-content',
        margin: '15% auto',
        width: '100%'
    },
    BoxLeft: {
        width: '50%',
        alignSelf: 'center',
        [theme.breakpoints.down('sm')]: {
            width: '100%'
        },
    },
    BoxRight: {
        width: '50%',
        display: 'flex',
        alignItems: 'center',
        [theme.breakpoints.down('sm')]: {
            width: '100%'
        },
    },
    bigHead: {
        color: 'black',
        textAlign: 'center',
        marginBottom: '10%',
        [theme.breakpoints.down('sm')]: {

        }
    },
    bigSubHead: {
        width: '60%',
        color: 'black',
        textAlign: 'center',
        margin: '0% auto',
        [theme.breakpoints.down('sm')]: {
            width: '90%',

        }
    },
    gridContainer: {
        display: 'flex',
        width: '100%',
        [theme.breakpoints.down('sm')]: {
            flexDirection: 'column',
            margin: '10% 0%'
        }
    },
    gridLeft: {
        display: 'flex',
        alignItems: 'center',
    },
    text: {
        color: 'black',
    }
}))

export function Quality({
    mainheading,
    mainsubheading,
    imageBG,
    heading,
    subhead,
    subtitle,
    subhead1,
    subtitle1,
    redline,
    download,
    href,
    list,
    uli,
    firstli,
    secli,
    thirdli,
    fourthli,
    style,
    style1,
}) {
    const classes = useStyles()
    return (
        <>
            <MainContainer>
                <Container fixed className={classes.qualityContainer}>
                    {
                        mainheading ?
                            <Box className={classes.mainHeads}>
                                <Bounce bottom>
                                    <h2 className={classes.bigHead}>{mainheading}
                                        <h6 className={classes.bigSubHead}> {mainsubheading}</h6>
                                    </h2>
                                </Bounce>
                            </Box> : ''
                    }

                    <Box className={classes.gridContainer}
                        style={style}
                    >

                        <Box className={classes.BoxLeft}>
                            <Bounce left> <PositionImage imageBG={imageBG} /></Bounce>
                        </Box>

                        <Box className={classes.BoxRight} style1={style1}>
                            <Bounce right>
                                <Paragraphs
                                    title={heading}
                                    subhead={subhead}
                                    subhead1={subhead1}
                                    subtitle={subtitle}
                                    subtitle1={subtitle1}
                                    redline={redline}
                                    list={list}
                                    uli={uli}
                                    firstli={firstli}
                                    secli={secli}
                                    thirdli={thirdli}
                                    fourthli={fourthli}
                                    download={download}
                                    href={href}

                                /></Bounce>
                        </Box>

                    </Box>
                </Container>
            </MainContainer>
        </>
    )
}
